func minOperations(nums []int, target int) int {
    count := make(map[int]int)
    for _, num := range nums {
        count[num]++
    }

    operations := 0
    for target > 0 {
        if target%2 == 1 {
            if count[1] > 0 {
                count[1]--
            } else {
                return -1
            }
        }
        target /= 2
        nextCount := make(map[int]int)
        for num, cnt := range count {
            if num == 1 {
                continue
            }
            if target >= num/2 {
                nextCount[num/2] += 2 * cnt
                operations += cnt
            } else {
                nextCount[num] = cnt
            }
        }
        count = nextCount
    }

    return operations
}
